// src/utils/api.js
export const registerCBO = async (formData) => {
    try {
      const response = await fetch("http://localhost:5000/api/cbo", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      });
  
      if (!response.ok) {
        throw new Error("Failed to register CBO");
      }
  
      const data = await response.json();
      return data;
    } catch (error) {
      console.error("Error registering CBO:", error);
      throw error;
    }
  };
